import inspect
import re
import html
from functools import wraps
from typing import Callable, Any, Dict, Tuple, List, Optional, Union

from pydantic import BaseModel


def escape_string_fields(escape_method: Union[str, Callable[[str], str]] = "re"):
    def get_escape_func() -> Callable[[str], str]:
        if callable(escape_method):
            return escape_method
        elif escape_method == "re":
            return re.escape
        elif escape_method == "html":
            return html.escape
        else:
            raise ValueError(f"Unknown escape method: {escape_method}")
    
    escape_func = get_escape_func()
    
    def decorator(func):
        is_async = inspect.iscoroutinefunction(func)
        
        if is_async:
            @wraps(func)
            async def wrapper(*args, **kwargs):
                processed_args, processed_kwargs = process_args_kwargs(args, kwargs, escape_func)
                return await func(*processed_args, **processed_kwargs)
        else:
            @wraps(func)
            def wrapper(*args, **kwargs):
                processed_args, processed_kwargs = process_args_kwargs(args, kwargs, escape_func)
                return func(*processed_args, **processed_kwargs)
        
        return wrapper
    
    return decorator


def process_args_kwargs(args: Tuple, kwargs: Dict[str, Any], escape_func: Callable[[str], str]) -> Tuple[List, Dict]:
    processed_args = []
    for arg in args:
        if isinstance(arg, BaseModel):
            processed_args.append(escape_model_strings(arg, escape_func))
        else:
            processed_args.append(arg)
    
    processed_kwargs = {}
    for key, value in kwargs.items():
        if isinstance(value, BaseModel):
            processed_kwargs[key] = escape_model_strings(value, escape_func)
        else:
            processed_kwargs[key] = value
    
    return processed_args, processed_kwargs


def escape_model_strings(model: BaseModel, escape_func: Callable[[str], str]) -> BaseModel:
    try:
        model_dict = model.model_dump()
    except AttributeError:
        model_dict = model.dict()
    
    for field_name, field_value in model_dict.items():
        if isinstance(field_value, str):
            model_dict[field_name] = escape_func(field_value)
    
    return type(model)(**model_dict)

/**
 * @param bool $result  Whether the notification conditions have passed
 * @param \GeminiLabs\SiteReviews\Addon\Notifications\Notification $notification  The Notification object
 *
 * @return bool - true if the notification should be sent, false otherwise.
 */
add_filter('site-reviews-notifications/notification/is-valid', function ($result, $notification) {
    $uid = 'abcdef'; // Replace with the UID of the notification.
    if (!$result || $uid !== $notification->get('uid')) {
        return $result; // Conditions have already failed or wrong notification
    }
    $user = wp_get_current_user();
    if (!in_array('retail', $user->roles)) {
        return false; // Skip if user does not have the retail role
    }
    if (wc_get_customer_order_count($user->ID) > 1) {
        return true; // Skip if not the first order
    }
    if (!empty(get_user_meta($user->ID, '_coupon_email_sent', true))) {
        return false; // Skip if user has already been sent a coupon
    }
    update_user_meta($user->ID, '_coupon_email_sent', 1);
    return true; // Send notification
}, 10, 2);

using Microsoft.Extensions.AI;
using Microsoft.Extensions.VectorData;
// using Microsoft.SemanticKernel.Connectors.InMemory;
using Microsoft.SemanticKernel.Connectors.MongoDB;

// var vectorStore = new InMemoryVectorStore();

var mongoClient = new MongoDB.Driver.MongoClient("mongodb://localhost:27017"); // ()
MongoDBVectorStore mongoDbVectorStore = new MongoDBVectorStore(mongoClient.GetDatabase("movies"), new MongoDBVectorStoreOptions());

// var moviesCollection = mongoDbVectorStore.GetCollection<int, MovieVector<int>>("movies"); //>()

// get movie list
var movies = mongoDbVectorStore.GetCollection<string, MovieVector<string>>("movies");
// await movies.CreateCollectionIfNotExistsAsync();
var movieData = MovieFactory<string>.GetMovieVectorList();

// get embeddings generator and generate embeddings for movies
IEmbeddingGenerator<string, Embedding<float>> generator =
    new OllamaEmbeddingGenerator(new Uri("http://localhost:11434/"), "all-minilm");
foreach (var movie in movieData)
{
    movie.Vector = await generator.GenerateEmbeddingVectorAsync(movie.Description);
    await movies.UpsertAsync(movie);
}

// perform the search
var query = "A family friendly movie that includes ogres and dragons";
var queryEmbedding = await generator.GenerateEmbeddingVectorAsync(query);
var searchOptions = new Microsoft.Extensions.VectorData.VectorSearchOptions<MovieVector<string>>()
{
    Top = 2,
    VectorPropertyName = "Vector",
    IncludeVectors = true,
};

try
{
    var results = await movies.VectorizedSearchAsync(queryEmbedding, searchOptions);

    await foreach (var result in results.Results)
    {
        Console.WriteLine($"Title: {result.Record.Title}");
        Console.WriteLine($"Description: {result.Record.Description}");
        Console.WriteLine($"Score: {result.Score}");
        Console.WriteLine();
    }
}
catch (Exception e)
{
    Console.WriteLine(e);
    throw;
}




